import React from 'react'
import { Container, Joke, Image } from './styles/savedJokes'

export default function savedJokes({ children, ...restProps }: any) {
  return <Container {...restProps}>{children}</Container>
}

savedJokes.IncrementButton = function IncrementButton({
  children,
  ...restProps
}: any) {
  return <IncrementButton {...restProps}>{children}</IncrementButton>
}

savedJokes.DecrementButton = function DecrementButton({
  children,
  ...restProps
}: any) {
  return <DecrementButton {...restProps}>{children}</DecrementButton>
}

savedJokes.SaveButton = function SaveButton({ children, ...restProps }: any) {
  return <SaveButton {...restProps}>{children}</SaveButton>
}
